<div class="text-container"><span id="t1_7" class="t s0_7"> אם הכל תקין</span><span id="t2_7" class="t s0_7">, </span><span id="t3_7" class="t s0_7"> לחצו כאן</span><span id="t4_7" class="t s0_7">): </span>
<span id="t5_7" class="t s1_7"> </span><span id="t6_7" class="t s2_7"> אישור על לימודים באולפן או לימודי תעודה</span>
<span id="t7_7" class="t s1_7"> </span><span id="t8_7" class="t s2_7"> אישור על קבלת קצבאות ממשרד העלייה והקליטה</span>
<span id="t9_7" class="t s1_7"> </span><span id="ta_7" class="t s2_7"> עו</span><span id="tb_7" class="t s3_7">" </span><span id="tc_7" class="t s2_7"> ש של כל שלושת החודשים האחרונים</span><span id="td_7" class="t s3_7">, </span><span id="te_7" class="t s2_7"> של כל החשבונות</span>
<span id="tf_7" class="t s4_7"> עולה חדשה</span></div>
